import React, { Component } from "react";

class Items extends Component {
  state = {};
  render() {
    return (
      <div className="campsiteItemsDiv">
        <h3>Campsite Items</h3>
        <h4>Tent</h4>
        <button>Add Tent</button>
        <h4>Sleeping bag</h4>
        <button>Add Sleeping bag</button>
        <h4>Sleeping Pad</h4>
        <button>Add Sleeping Pad</button>
        <h4>Camping Pillow</h4>
        <button>Add Camping Pillow</button>
        <h4>Flashlight</h4>
        <button>Add Flashlight</button>
        <h4>Camping Chair</h4>
        <button>Add Camping Chair</button>
        <h4>Lantern</h4>
        <button>Add Lantern</button>
      </div>
    );
  }
}

export default Items;
